from collections import deque

def minKnightMoves(x, y):
    (x, y) = (abs(x), abs(y))
    if x <= y:
        (x, y) = (y, x)
    dq = deque([(0, 0, 0)])
    visited = set((0, 0))
    while dq:
        (i, j, step) = dq.popleft()
        if (i, j) == (x, y):
            return step
        for (dx, dy) in [(-1, -2), (-2, -1), (-2, 1), (-1, 2), (1, 2), (2, 1), (2, -1), (1, -2)]:
            (ni, nj) = (i + dx, j + dy)
            if -1 <= ni <= x + 2 and -1 <= nj <= y + 2 and ((ni, nj) not in visited):
                visited.add((ni, nj))
                dq.append((ni, nj, step + 1))

